class Counter extends Component {
    state = {
        counter: 0
    }
    render() {
        return (
            <>
                <h2>Pozdrav iz Child komponente!</h2>
                <p>Ja sam paragraf!</p>
                <p>Count: {this.counter} </p>
            </>
        );
    }
}

export default Counter;
